import 'style.less'

const ArticleList = (props) => {
  const { dataSource } = props
  return <div className="article-list">
    {
      dataSource.map(item => {
        const { article_title, article_id } = item
        return (
          <div key={article_id}>
            {article_title}
          </div>
        )
      })
    }
  </div>
}

export default ArticleList
